function hsIntro() {
    var lasops = document.getElementById("introiframe")
    if("hidden" in lasops.classList){
        lasops.classList.remove("hidden")

    }else{
      lasops.classList.add("hidden")
    }
}


var brillovar = document.getElementById("brillo").value;
var brillo_segvar = document.getElementById("brillo_seg").value;

var zoomvar = document.getElementById("zoom").value;
var zoom_segvar = document.getElementById("zoom_seg").value;

var txtopavar = document.getElementById("txtopa").value;

var degra = ` `;




function cambiopadding() {

  const listapad = document.querySelectorAll("#projsec .col-md") 

  
  var pon = "p-"+ document.getElementById("imgpad").value;
  var quita = listapad[0].classList[1]

  for (let i = 0; i < listapad.length; i++) {
    listapad[i].classList.remove(quita)
    listapad[i].classList.add(pon)
  }
}


function updateCSS() {
  var newcss =
    `
    .img_description_wht {
  position: absolute;
  top: 50%;
  left: 50%;
  color: rgba(255, 255, 255, 0.815);
  visibility: hidden;
  opacity: 0;
  transform: translate(-50%, -50%);
  text-align: center;
  transition: opacity ` +
    window.txtopavar +
    `s, visibility 0.5s;
}
    .img-ho img {
  transform-origin: 50% 65%;
  transition: transform ` +
    window.zoom_segvar +
    `s ease, filter ` +
    window.brillo_segvar +
    `s ease-in-out;
  filter: brightness(100%);
}

.img-ho:hover img {
  transform: scale(` +
    window.zoomvar +
    `);
  filter: brightness(` +
    window.brillovar +
    `%);
}    
#lgrad {` +
    window.degra +
    `}`;

  document.getElementById("custom-styles").innerHTML = newcss;
}

function cambioBrillo() {
  window.brillovar = document.getElementById("brillo").value;
  window.brillo_segvar = document.getElementById("brillo_seg").value;

  document.getElementById("brillo_txt").innerHTML =
    "Cambiar brillo al " + "(" + window.brillovar + "%)";
  document.getElementById("brillo_seg_txt").innerHTML =
    "Duraci贸n transici贸n en seg " + "(" + window.brillo_segvar + ")";

  updateCSS();
}

function cambiozoom() {
  window.zoomvar = document.getElementById("zoom").value;
  window.zoom_segvar = document.getElementById("zoom_seg").value;

  document.getElementById("zoom_txt").innerHTML =
    "Cambiar del Zoom " + "(" + window.zoomvar + ")";
  document.getElementById("zoom_seg_txt").innerHTML =
    "Duraci贸n transici贸n en seg " + "(" + window.zoom_segvar + ")";

  updateCSS();
}

function cambiotexto() {
  window.txtopavar = document.getElementById("txtopa").value;

  document.getElementById("txtopa_txt").innerHTML =
    "Tiempo hasta aparecer en seg (" + window.txtopavar + ")";

  updateCSS();
}

function cambiofondo() {
  window.degra = document.getElementById("fondoDeg").value;
  updateCSS();
}

