function updateFont() {
  var lafue = document.getElementById("fontselect").value;
  var elpe = document.getElementById("fontwght").value;
  var curs = document.getElementById("cursive").checked;

  if (curs) {
    curs = ":ital,wght@1,";
  } else {
    curs = ":wght@";
  }

  var ellink =
    "https://fonts.googleapis.com/css2?family=" +
    lafue +
    curs +
    elpe +
    "&display=swap";

  var add1 = document.getElementById("gfontadd");
  add1.setAttribute("href", ellink);
  add1.setAttribute("rel", "stylesheet");

  //font-family: 'Montserrat', sans-serif;

  document.getElementById("add-gf").innerHTML =
    `body{
  font-family: '` +
    lafue +
    `' , ` +
    fuente[lafue].type +
    `;
  }`;

  console.log(lafue + curs + elpe);
}

function mirarCursi() {
  var haycur = document.getElementById("fontselect").value;

  // parte de cambiar la cursiva
  var domtar = document.getElementById("cursive");

  if (Object.keys(fuente[haycur].variants).length > 1) {
    if (domtar.hasAttribute("disabled")) {
      domtar.removeAttribute("disabled");
    }
  } else {
    if (!domtar.hasAttribute("disabled")) {
      domtar.checked = false;
      domtar.setAttribute("disabled", "");
    }
  }

  // actualizar tipos disponibles por fuente
  if (document.getElementById("cursive").checked) {
    var pesos = fuente[haycur].variants["italics"];
  } else {
    var pesos = fuente[haycur].variants["normal"];
  }

  const myNode = document.getElementById("fontwght");
  myNode.textContent = "";

  // si es unico asignar si no el loop de abajo
  if (!Array.isArray(pesos)) {
    var option = document.createElement("option");
    option.text = pesos;
    option.value = pesos;
    fontwght.add(option);
  } else {
    for (var i = 0; i < pesos.length; i++) {
      var option = document.createElement("option");
      option.text = pesos[i];
      option.value = pesos[i];
      fontwght.add(option);
    }
  }
}

// Aqui lo de los botones de projects

function filterproj(cate) {
  document.getElementById("projsec").setAttribute("style","opacity:0;");

  // change selected style
  var losbotones = document.querySelectorAll("#navproje .button");

  for(let i = 0;i < losbotones.length;i++){
    if(losbotones[i].innerHTML == cate){
      losbotones[i].setAttribute("style","border-bottom: 2px solid;");
    }else{
      losbotones[i].removeAttribute("style");
    }
  }

  // todos los proj
  var posTarget = document.querySelectorAll("#projsec .col-md");

  // get second p
  var p2check = document.querySelectorAll("#projsec .fs-5");


  if(cate != "All"){

    for (let i = 0; i < p2check.length; i++) {
    var mirar = p2check[i].innerHTML.trim();

    if(mirar == cate){
      setTimeout(function(){
      posTarget[i].setAttribute("style","display: block; opacity:1;");
      },800);
    }else{
      setTimeout(function(){
      posTarget[i].setAttribute("style","display: none; opacity:0;");
      },800);
    }

        }
    } else {  
      for (let i =0; i < p2check.length; i++){
        setTimeout(function(){
        posTarget[i].setAttribute("style","display: block; opacity:1;");
        },800);
      }
    }
  
  setTimeout(function () {document.getElementById("projsec").setAttribute("style","opacity:1;");}, 800);
}

